function:
body = parse_xml!(.body)
.System = body.Event.System
.Data = {}
dataarray, err = array(body.Event.EventData.Data)
if err == null {
    for_each(dataarray) -> |_index, attr| {
        key, err = string(attr.@Name)
        if err == null {
            value = attr.text
            dict = map_keys({"_": value}) -> |k| { key }
            .Data |= dict
        }
    }
} 
.
